import React, { useState, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import PostList from './PostList';
import '../styles/styleChat.css';

function Frontoffice() {
  const formParolaRef = useRef(null);
  const formAnnoRef = useRef(null);

  const [parolaDaCercare, setParolaDaCercare] = useState('');
  const [annoScelto, setAnnoScelto] = useState('2024');
  const [postList, setPostList] = useState([]);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const loginRedirect = () => navigate('/login');

  const filterRequest = async (parolaDaCercare, annoScelto) => {
    try {
      const response = await fetch(
        `http://localhost:3000/api/filterRequest?ricercaParola=${parolaDaCercare}&ricercaAnno=${annoScelto}`,
        {
          method: 'GET',
          headers: { 'Content-Type': 'application/json' },
        }
      );

      const data = await response.json();
      if (response.status === 200) setPostList(data.result);
      else {
        setError(data.message);
        setPostList([]);
      }
    } catch (error) {
      console.error('Errore durante il filtro:', error);
      setError('Errore del server.');
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formId = e.target.id;
    filterRequest(parolaDaCercare, annoScelto);
  };

  return (
    <div className="paginaIntera">
      {/* HEADER */}
      <header className="header">
        <div className="logo">LOGO</div>
        <div className="header-title">HEADER</div>
        <button className="login-btn" onClick={loginRedirect}>
          LOGIN
        </button>
      </header>

      {/* WELCOME SECTION */}
      <section className="welcome">
        <h2>Welcome text</h2>
        <div className="introduzioneMioBlog">
          <p>
            Ciao, benvenuto nel mio blog personale, mi chiamo Matteo Kalcich, ho 18 anni e
            studio informatica. Amo programmare e scoprire nuovi aspetti della tecnologia.
          </p>
        </div>
      </section>

      {/* RICERCA */}
      <section className="ricerca-container">
        <form ref={formParolaRef} onSubmit={handleSubmit} className="ricerca" id="ricercaParola">
          <label htmlFor="parolaDaCercare">RICERCA</label>
          <input
            type="text"
            id="parolaDaCercare"
            value={parolaDaCercare}
            onChange={(e) => setParolaDaCercare(e.target.value)}
            placeholder="Parola chiave..."
          />
          <button type="submit">CERCA</button>
        </form>
      </section>

      {/* FILTRA PER ANNO */}
      <section className="filtraAnno-container">
        <form ref={formAnnoRef} onSubmit={handleSubmit} className="filtraAnno" id="ricercaAnno">
          <button type="button" className="firstLastBtn">
            PRIMO
          </button>
          <button
            type="button"
            className="afterFirstBeforeLastBtn"
            onClick={() => setAnnoScelto((prev) => String(parseInt(prev) - 1))}
          >
            &laquo; Precedente
          </button>
          <div className="annoCorrente">Anno {annoScelto}</div>
          <button
            type="button"
            className="afterFirstBeforeLastBtn"
            onClick={() => setAnnoScelto((prev) => String(parseInt(prev) + 1))}
          >
            Successivo &raquo;
          </button>

          <button type="button" className="firstLastBtn">
            ULTIMO
          </button>
        </form>
      </section>

      {/* POST LIST */}
      <section className="post">
        <PostList posts={postList} />
      </section>

      {/* FOOTER */}
      <footer className="footer">FOOTER</footer>
    </div>
  );
}

export default Frontoffice;
